import React from "react";

function NameList() {
  const persons = [
    {
      id: 1,
      name: "Big guy",
      age: 30,
      skill: "React",
    },
    {
      id: 2,
      name: "Joca",
      age: 30,
      skill: "Java",
    },
  ];
  const personList = persons.map((person) => (
    <h3>
      This is id no {person.id} and the name is {person.name}
    </h3>
  ));
  return <div>{personList}</div>;
}

export default NameList;
